import styled from "styled-components";
import Tilt from "react-tilt";
export const LogoContainer = styled.div.attrs({
  className: `ma4 mt0`,
})``;

export const TiltContainer = styled(Tilt).attrs({
  className: `Tilt" br2 shadow-2 options={{ max: 25 }}>`,
})``;
